const Bookingform = () => (
  <Container style={{ padding: 16, margin: "auto", maxWidth: 800 }}>
    <Typography
      variant="h4"
      align="center"
      component="h1"
      style={{ padding: 16 }}
    >
      Parking Lot Management System !
    </Typography>
          <Form>
          <Paper style={{ padding: 16 }}>
            <Grid
              container
              justify="flex-start"
              alignItems="center"
              spacing={2}
            >
              <Grid item xs={12}>
                <Field
                  name="name"
                  fullWidth
                  component={TextField}
                  type="text"
                  label="Vehicle Number"
                />
              </Grid>

              <Grid item xs={12}>
                <Field
                  name="Entry_Time"
                  fullWidth
                  component={TextField}
                  type="time"
                  defaultValue="00:00:00"
                  label="Entry Time"
                />
              </Grid>

              <Grid item xs={12} mt={4}>
                <Field
                  name="Exit_Time"
                  fullWidth
                  component={TextField}
                  type="time"
                  defaultValue="00:00:00"
                  label="Exit Time"
                />
              </Grid>

              <Grid item xs={12}>
                <Field
                  name="No Of Slots"
                  fullWidth
                  component={TextField}
                  type="text"
                  label="No Of Slots"
                />
              </Grid>

              <Grid
                container
                justify="space-evenly"
                alignItems="center"
                style={{ padding: 16 }}
              >
                <Button
                  variant="contained"
                  color="primary"
                  type="submit"

                >
                  Submit
                </Button>
                <Button
                  variant="contained"
                  color="secondary"
                  type="button"

                >
                  Reset
                </Button>
              </Grid>
            </Grid>
          </Paper>
          </Form>
  </Container>
);

export default Bookingform;
